Create your first Skill

Let's create a new skill from scratch !


Navigate to the Skills tab.
Click *New Skill.
Give a name to your new skill, let's add a "jokes" skill that will query fun jokes from an external API.
As we will query an external API, select "API request" as the Skill's type.
Click Generate template.




Welcome to the Skill Edition Mode. Here, you can edit the code of your skill. (And must save it before configuring it.) You have to keep the template or your skill will not save.
As you may see, because you selected the "API Request" type, you already have the request library listed as a dependency. Let's require it. All you code will be in the  section:


