Our skill will have to respond the the !joke command. Click the Add command tool and give a name to the command, let's call it say-a-joke. The command will be what users will type, write joke. And we will give a nice name to our function, like sayJoke. Click Add command, and the editor will create a new template for you, and add the command declaration to the top of the file.

