Save you Skill by clicking the Save icon. Your Skill is now up, and you may run it by toggling the red pill near its name in the *Skills tab.
You may edit your skill and configure its secrets (let's say, if your API require authentification).

brain/skills.html.body:
Skills
Skills are small scripts executed by the brain node server. They expose their commands and intents. Skills are automatically loaded by the bot on startup, and may be added at runtime, or removed/disabled.
Skills are edited from with the dashboard (or using the arachne API). You can edit their code or their secret variables (like token for external services).
Skill code and secrets are stored locally in the /logic/skills folder only for runtime purposes. Skills are persisted in the brain database, and will load these distants skills at startup. Therefore editing local files WILL NOT persist modifications ! You MUST use the dashboard or the brain API.
See the api documentation for the complete list of endpoints available to manage skills.
Definition of a Skill
A skill is a file that exports a function taking as parameter a Skill object:
/*
  SKILL: HELLO
  AUTHOR: NAKASAR
  DATE: 
*/

module.exports = (skill) => {
  skill.setDescription("This is my Skill");
}

Expose a new command
To add a new command, call the skill.addCommand(cmd, name, handler, help) method. The cmd parameter is the command word typed by the user to call the command, the handler is a Function({ phrase, data }) that will be called by the brain. You must also define a help object with at least a description (some examples would be welcomed).
The cmd word is unique accross all the brain, and your skill will not load if another skill already use this command word. First in, first out.
The handler is a Promise that resolves to a response object containing a message: { title, text, attachments... }. The brain will return to the sender of the command this message object. If you need to send additionnal data in case another skill executed the command, set it in the response object, not in the message object.
The help object is used by the brain to generate help for skills, so that any user can easily now what the brain can do. The manual is available at this url: http://brainurl/manual, or, for thoe who miss the man page, at http://brainurl/help/man.
Your handler will get a phrase string which is what the user typed (without the cmd word), and a data object that contains additionnal data, such as the username, the channel identifier, the adapter identifier...
/*
  SKILL: HELLO
  AUTHOR: NAKASAR
  DATE: 
*/

module.exports = (skill) => {
  skill.setDescription("Can say hello!");

  skill.addCommand("hello", "say-hello", ({ phrase, data }) => {
    // The handler must be a promise that resolves to a response.
    // The response contains a message object that can be complex, or as simple as some text.
    return Promise.resolve().then(() => {
      let text;
      if (phrase.length > 0) {
        // We have a user to greet.
        text = "Welcome " + phrase;
      } else {
        text = "Welcome my friend!"
      }

      return {
        message: {
          title: "Hello!",
          text: text
        }
      };
    }).catch(err => {
      // You should always return something to the user.
      // If you don't, the brain will send a generic error message.
      // So you'd better catch any final errors here.
      return {
        message: {
          text: "I couldn't say hello, I'm sorry."
        }
      };
    });
  }, {
    description: "Say hello.",
    parameters: [
      {
        position: 0,
        name: "user",
        description: "Name of the user to greet (optional)",
        example: "Nakasar"
      }
    ]
    examples: [
      {
        phrase: "!hello",
        action: "Displays a greeting."
      },
      {
        phrase: "!hello Nakasar",
        action: "Displays a personnal greeting."
      }
    ]
  })
}

Add a new intent.
You can define intents that will be called when users talk to the bot with natural language. Intents are returned from a Natural Language Understanding service such as Wit.ai, DialogFlow, Recast.ai, or anything else that returns intents and entities from a sentence.
Whenever the brain receives a sentence, it will execute a command called analyze, so you better create a skill that exposes such a command. This command must return a response object of this format:
return {
  message: {
    text: `Sentence analyzed. ${intentslug ? `Intent found: ${intentslug}`: "No intent found."}`
  },
  intent: intentslug,
  entities: {
    'lang': [
      'french'
    ]
  }
}

The brain will then look for a skill that has a handler for the intentslug found, and call this handler.
To declare an intent for your skill, use the skill.addIntent(slug, name, handler) method.
The slug is unique accross all the brain, and your skill will not load if another skill already use this intent slug. First in, first out.
The handler is a Promise that resolves to a response object containing a message: { title, text, attachments... }. The brain will return to the sender of the intent this message object.
Your handler will get a phrase string which is what the user typed (without the cmd word), and a data object that contains additionnal data, such as the username, the channel identifier, the adapter identifier...
/*
  SKILL: HELLO
  AUTHOR: NAKASAR
  DATE: 
*/

module.exports = (skill) => {
  // skill.addCommand(hello...);

  skill.addIntent("say-hello", "say-hello", ({ entities, data }) => {
    // The handler must be a Promise that resolves to a response.
    // The response contains a message object that can be complex, or as simple as some text.
    return Promise.resolve().then(() => {
      if (!entities.lang) {
        return {
          message: {
            text: "You didn't tell me in what language I should say hello!"
          }
        }
      }
      let text;
      switch(entities.lang[0]) {
        case "french":
          text = `Bonjour ${data.username || "mon ami !"}`;
          return text;
        case "english":
          text = `Hello ${data.username || "folk!"}`;
          return text;
        case "japanese":
          text = `こんにちはケビン!`;
          return text;
        default:
          text = `I'm afraid I don't speak this langage, sorry.`;
          return text;
      }
    }).then(greeting => {
      // The handler is a Promise, so don't hesitate to use the Promise chaining mecanism.
      return {
        message: {
          text: greeting
        }
      }
    }).catch(err => {
      // You should always return something to the user.
      // If you don't, the brain will send a generic error message.
      // So you'd better catch any final errors here.
      return {
        message: {
          text: "I couldn't say hello, I'm sorry."
        }
      };
    });
  });
}

Using brain components
Use skill commands from within another skill
Skills can execute other skill's commands (some skill may restrict what skills can access their commands through an auth system):
module.exports = (skill) => {
  /*
    Here goes the definition of the skill.
  */

  skill.addCommand("hello", "say-hello", ({ phrase, data }) => {
    return skill.execute("helloworld", ({ phrase, data })); // Will call the helloworld command from another skill.
  }, { description: "Will say hello." });
}


Don't forget to catch the error, in case the command was deactivated!

Anything outside the message object returned by a skill will never be sent to any adapter, but might be accessible to other skill using the execute method.
Store a secret variable.
You may want to define secret variables, such as an API token or credentials to a service. You don't want to store these in the skill file, as it may be visible by other users that have the permission to access this skill.
The Skill object allow you to retrieve a secret for a skill that you can set with the API or the dashboard:
module.exports = (skill) => {
  const secret = skill.getSecret();
  skill.log("My secret token is " + secret.token);
}

Log something
Each skill store their own logs so that you can easily understand what goes wrong and when, without being able to access the logs of skill you should'nt see.
module.exports = (skill) => {
  skill.log("Skill is up and loaded!");
  skill.log({ message: "I can log objects too!" });
}

Do so much more?
The next sections explain how to handle conversations and how to create hooks with an adapter. But before, we will learn to create rich messages.

brain/messages.html.body:
Message formatting
Adapters reformat messages to send rich embeded message (if any) to clients. The brain must send compatible message format.
The simpliest message a skill may return from one of its Promise is the following :
return { message: { text: "This is a very simple message." } };

You may add some additionnal information to the message object, like a title, or change the message avatar (using the image url instead of bot avatar, or the give emoji, not supported by all adapter!) :
return {
  message: {
    title: "Hey!",
    avatar: "https://assets-cdn.github.com/images/modules/logos_page/GitHub-Mark.png",
    emoji: ":smirk:",
    text: "This message has an amazing title!"
  }
};

Attachments
Messages can display several attachments, these are additionnals fields displayed after the message. They can contain images, video, files, buttons, text...

Attachments are listed under the attachments array of the message object :
return {
  message: {
    title: "An incredible message",
    text: "This message is surely the best!",
    attachments: [
      {
        color: "#ff0000",
        text: "This text will have a red border and an alert icon. Cool!",
        thumbnail: "http://www.gohrt.com/images/icons/alert-icon-red.png"
      },
      {
        color: "#00ff00",
        title: "What a video!",
        title_link: "https://www.youtube.com",
        collapsed: true,
        video_url: "https://www.youtube.com/watch?v=dQw4w9WgXcQ",
        author_name: "Some artist",
        author_link: "http://wikipedia.com"
        author_icon: "https://assets-cdn.github.com/images/modules/logos_page/GitHub-Mark.png"
      },
      {
        title: "What an image!",
        image_url: "https://pre00.deviantart.net/e95b/th/pre/i/2011/267/e/2/french_montain_by_bancomphotos-d4ardpn.jpg"
      },
      {
        color: "#000000",
        title: "Some table",
        text: "Here are a lot of fields!",
        fields: [
          {
            title: "Fun fact 1",
            message: "I lied, it's not a fact."
          },
          {
            title: "Fun fact 2",
            message: "I lied, again."
          }
        ]
      }
      ...
    ]
  }
};

brain/conversations.html.body:
Threads and Conversations
Skills can notify the hub that their response is awaiting one from the user (like a confirmation, or a selection). For that, they need to create a Thread stored by the hub, via the overseer they can require. This will create a unique thread id that the skill must return to the adapter. The adapter will then activate the "conversation mode" for the next reply, and send it to the /converse endpoint with the thread id they received. The hub will call the skill handler defined for this thread at his creation.

Create a conversation in a skill
To handle a conversation for your skill, you first need to declare a new interaction with the skill.addInteraction(name, handler). The name, once again, has to be unique accross all skills. The handler is a Function(thread, { phrase, data }) that returns a Promise to a response object:
module.exports = (skill) => {
    skill.addInteraction("lang-selection", (thread, { phrase, data }) => {
        return Promise.resolve().then(() => {
            const knowLanguages = ["french", "japanese", "english"];

            if (phrase === "quit") {
                return {
                    message: {
                        text: "Alright!"
                    }
                }
            } else if (phrase && knowLanguages.includes(phrase)) {
                // Here, we will call our hello command while populating the arguments of the command with the language.
                return skill.handleCommand("hello", { phrase: phrase, data });
            } else {
                // Return a message that will continue this conversation by passing the given thread object.
                return {
                    message: {
                        text: `I don't know this language, sorry. I can only talk in: ${knowLanguages.join(", ")}. Please select another one or quit.`,
                        interactive: true,
                        thread: thread
                    }
                }
            }
        }).catch(err => {
            return {
                message: {
                    text: "Something went wrong, I'm sorry."
                }
            };
        });
    });
}

To create a new conversation using the created handler, populate the message object with interactive: true and a thread object.
The thread object expect the phrase that solicitate the conversation in source. You can store data in this thread as [[key, value]] array. You can set a duration and a timeout_message to display if the thread timeout. Finally, you must specify the name of the handler.
...
// Code in the skill logic
return {
    // return the message with the thread parameters to create a thread
    message: {
        // interactive true, required to create a thread or continue a thread
        interactive: true,
        // thread parameter, required to create a thread
        thread: {
            // The source phrase that created the thread, ( optional )
            source: phrase,
            // Eventual data to add to the thread, ( optional )
            data: [[data_un, 42], [data_deux, "data_deux"],
            // the handler, REQUIRED, ie the name in the interaction object above 
            handler: "lang-selection",
            // duration of thread before timeout ( optional, default set to 30 )
            duration: 10,
            // The time out message ( optional )
            timeout_message: "Contact me again if you need something."
        },
        title: "Select a language",
        text: "In what language should I say hello in?"
    }
};

brain/hooks.html.body:
Hooks
Skills can anchor hooks with adapters that implements them. They can register a new Hook using the skill.createHook() method. The creator can add a third parameter ( a string ), to specify the string that the adapter will return when closing this hook, example : "This hook can be called only once !". This will return a Promise to the created hook. The hook will not be valid, and the adapter must confirm before it can be executed. To request a hook, the message object returned by the skill must contain request_hook: true and hook: . Adapters should understand the request when parsing the message, and will validate the hook. Then, the skill will be able to execute the hook with skill.useHook(hook_id, message) (which is a Promise). The creator can add a third parameter : {deleteHook: true} to delete the hook after it execution.

Nota Bene: It is the responsability of the skill to handle Promise rejections with personnalized error messages.

When executing a hook, in case of an error, you will receive an error code that you can use to update your skill's storage. For instance, if you catch NO_HOOK, it means the Hook was deleted by the hub, or NO_CONNECTOR_LINKED if no connector accepted the hook, or NO_CONNECTOR_ONLINE if the linked connector could not be reached.
Example
In this example, we request a new Hook and set a alarm that will display a message in the channel.
module.exports = (skill) => {
  const schedule = skill.loadModule("node-schedule");

  skill.setDescription("Set and manage alarms.");

  /*
   * Will not persist the alarm, we should add the alarm to the storage here.
   */
  skill.addCommand("alarm", "set-alarm", ({ phrase, data }) => {
    return Promise.resolve().then(() => {
      let time = new Date();
      let text = "";

      try {
        const [timeString, ...textArray] = phrase.split(" ");
        text = textArray ? textArray.join(" ") : "";

        let [hours, minutes] = timeString.split(/[:h\-]/i);
        hours = parseInt(hours, 10);
        minutes = parseInt(minutes, 10);
        if (isNaN(hours) || hours  24) {
          throw "Invalid hour format.";
        }
        if (isNaN(minutes) || minutes = 60) {
          throw "Invalid minutes format.";
        }
        time.setHours(hours, minutes, 0, 0);


        return skill.createHook("Alarm rang, hook removed.").then(hook => {
          schedule.scheduleJob(time, () => {
            skill.useHook(hook._id, {
              message: "Alarm",
              text: text
            }, { deleteHook: true }).catch(err => skill.log(err));
          });

          return {
            message: {
              text: "Alarm set!"
            }
          }
        });
      } catch (e) {
        return {
          message: {
            title: "Invalid time format.",
            text: "Type `!alarm hh:mm` to create a new alarm."
          }
        }
      }


    });
  }, {
    description: "Set a one-time alarm.",
    parameters: [
      {
        position: 0,
        name: "time",
        example: "16:40",
        description: "Time to set the alarm"
      },
      {
        position: 1,
        name: "text",
        example: "It's tea time!",
        description: "Text to send with the alarm."
      }
    ]
    examples: [
      {
        phrase: "!alarm 16h Tea Time!",
        action: "Will say 'Tea Time!' in the channel at 16h00."
      }
    ]
  });
}

brain/weather.html.body:
Skill Example : API
Here is an example of skill fetching weather on a weather API service:
/*
  SKILL : weather
  AUTHOR : System
  DATE : 17/04/2018
*/

module.exports = (skill) => {

    const axios = skill.loadModule('axios');
    const token = skill.getSecret().token;
    const weatherApi = `http://api.openweathermap.org/data/2.5/weather?APPID=${token}&lang=fr&units=metric`;
    const weatherIcon = 'http://openweathermap.org/img/w/';

    skill.addCommand("weather", "weather", ({ phrase, data }) => {
        return Promise.resolve().then(() => {
            // Build the request
            let location = phrase.trim().replace("weather", "").trim();
            if (location === '') {
                location = 'Kayl,lu';
            }
            let query = "&q=" + location;
            // Make the query
            return axios({
                url: weatherApi + query,
                method: 'GET',
            }).then((res) => {
                res = res.data;
                // No error
                let imageUrl;
                let description = '*' + res.main.temp + '° - ';
                // If the respons contain the weather property , print it
                if (res.weather) {
                  imageUrl = weatherIcon + res.weather[0].icon + '.png';
                  description += res.weather[0].description + '*\n';
                }
                // Then print the weather
                description += '>Température min : _' + res.main.temp_min + '°_\n'; // jshint ignore:line
                description += '>Température max : _' + res.main.temp_max + '°_\n'; // jshint ignore:line
                description += '>Humidité : _' + res.main.humidity + '%_\n';
                description += '>Pression : _' + res.main.pressure + ' hPa_\n';
                description += '>Visibilité : _' + res.visibility / 1000 + ' km_\n';
                description += '>Vent : _' + res.wind.speed + ' km/h_';
                return {
                    message: {
                        attachments: [{
                        title: `Météo à ${location}`,
                        text: description,
                        thumb_url: imageUrl, // jshint ignore:line
                        color: 'black'
                    }]}
                };
            }).catch((error) => {
                throw "Couldn't contact the weather API";
            });
        }).catch((error) => {
            if(typeof(error) !== String) error = error.toString();
            skill.log("Error : " + error);
            return({
                message: {
                    title: "Error",
                    text: error
                }
            });  
        });
    }, {
        description: "Récupère le temps actuel à un lieux donné",
        "subcommands":[
            {
                "name":"get-weather",
                "cmd":"",
                "description":"Renvoie les events en fonction du paramètre entrée",
                "parameters":[
                    {
                        "position":0,
                        "name":"lieux",
                        "description":"lieux où le temps doit être cherché",
                        "example":"luxembourg ville"
                    }
                ],
                "examples":[
                    {
                        "phrase":"weather Paris",
                        "action":"renvoie le temps à paris"
                    },
                    {
                        "phrase":"weather Metz",
                        "action":"renvoie le temps à Metz"
                    }
                ]
            }
        ]
    });

    skill.addIntent("weather", "weather", ({ entities: { location: location = [] }, data }) => {
        if (location.length === 0) {
            return Promise.resolve({ message: { text: "I am expecting a location." }});
        } else {
            return skill.handleCommand("weather", { phrase: location[0], data });   
        }
    });
}

brain/quizz.html.body:
Skill Example : API
Here is an example of skill fetching question on a distant quizz API service that uses the Conversation mode.
/*
  SKILL : quizz
  AUTHOR : Anonymous
  DATE : 14/05/2018
*/

module.exports = (skill) => {
    const axios = skill.loadModule('axios');

    skill.addCommand("quizz", "quizz", ({ phrase, data }) => {
        return Promise.resolve().then(() => {
            return axios({
                url: "https://opentdb.com/api.php?amount=1&difficulty=medium&type=multiple"
            }).then((response) => {
                var body = response.data;
                let source = decodeURI(body.results[0].question);
                let question = "Quizz:\n*" + source + "*";
                let answers = [];
                let incorrect_answers = [];
                body.results[0].incorrect_answers.forEach((value) => {
                    incorrect_answers.push(decodeURI(value));
                });
                let correct_answer = decodeURI(body.results[0].correct_answer);
                answers = incorrect_answers;
                answers.push(correct_answer);
                answers.sort();

                question += "\n> " + answers.join("\n> ");
                question += "\n (type `abort` or `skip` to skip)";
                return({
                    message: {
                        interactive: true,
                        thread: {
                            source,
                            data: [
                                ["correct_answer", correct_answer],
                                ["incorrect_answers", incorrect_answers]
                            ],
                            handler: "thread-quizz-handler",
                            duration: 30,
