                    }).catch((err) => {
                        return resolve({
                            message: {
                                title: "Tea Timer",
                                text: "Tea Timer cannot set a hook in this channel, sorry."
                            }
                        })
                    });
                }
            } catch (e) {
                return resolve({
                    message: {
                        title: "Tea Timer",
                        text: "Type `!tea ` to set a timer for your tea."
                    }
                });
